import React from 'react';

import { EntryDetail } from './EntryDetail'

export const EntriesList = ({entries, base_url, onClick, onRemoveClick, editDelete}) => (

    <div className="table_container">
        {
            entries.length>0 ?
            (
                entries.map(entry =>
                    <EntryDetail editDelete={editDelete} key={entry.id} entry={entry} base_url={base_url} onClick={onClick} onRemoveClick={onRemoveClick}/>
                )
            ) : (
                <div key="no_results" className="no_results"> No se han encontrado resultados </div>
            )
        }
    </div>
);
